import styled from "styled-components";

export default styled.header`
    background-color: transparent;
    display: grid;
    grid-template-columns: 2.2vw 20vw auto 6vw 6vw 6vw 10vw;
    text-align: center;
    padding: 1.5em 4.5em;
`;
